// src/App.js
import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import { useKeycloak } from '@react-keycloak/web';
import { Box } from '@mui/material';
import Navbar from './components/Navbar';
import Chat from './components/Chat';
import FichaPaciente from './components/FichaPaciente';
import Dashboard from './components/Dashboard';
import LoginButton from './components/LoginButton';
import PrivateRoute from './components/PrivateRoute';

const drawerWidth = 240;

function App() {
  const { keycloak, initialized } = useKeycloak();

  if (!initialized) {
    return <div>Carregando...</div>;
  }

  return (
    <Box sx={{ display: 'flex' }}>
      {/* Navbar Lateral Fixa */}
      <Navbar />
      
      {/* Conteúdo Principal ao lado direito do Navbar */}
      <Box
        component="main"
        sx={{ flexGrow: 1, bgcolor: '#f0f2f5', p: 3, ml: `${drawerWidth}px` }}
      >
        <Routes>
          {/* Redirecionamento inicial para o Dashboard */}
          <Route path="/" element={keycloak.authenticated ? <Navigate to="/dashboard" /> : <LoginButton />} />
          
          {/* Rotas protegidas */}
          <Route element={<PrivateRoute />}>
            <Route path="/dashboard" element={<Dashboard />} />
            <Route path="/chat" element={<Chat />} />
            <Route path="/ficha-paciente" element={<FichaPaciente />} />
          </Route>
          
          {/* Redirecionamento para o Dashboard caso rota não encontrada */}
          <Route path="*" element={<Navigate to="/dashboard" />} />
        </Routes>
      </Box>
    </Box>
  );
}

export default App;
